INSERT INTO `Session` VALUES (27647,'SAP Talk','S/4HANA','13:00 - 13:20','7F Pearl Hall','SAP S/4HANA Essentials','SAP S/4HANA needs to be seen in the context of the digital economy discussions we are having with our clients and partners. To make this tangible, we have developed key use cases to explain the value proposition from a business and technical point of view. Join this session and learn where we see the focus, what resonates with clients, and how our technical advantage can play out for them.',1456722000,1456723200,0,'session/s4h.png'),(27692,'Developer Faire','Small & Medium Enterprises','11:30 - 12:00','Developer Faire 2','Simple Yet Fancy E-Shop Using SAP Anywhere','SAP is providing a solution for customers to open a simple yet fancy e-shop: SAP Anywhere specifically targeted at the SME market. Consider how using this solution, customers can gain these benefits. 1. Open and decorate their e-shops with one key. 2. List/delist products quickly. 3. Manage price lists and promotions conveniently. 4. Manage customers centrally. 5. Manage inventory across channels. 6. Manage rich content conveniently. During this session, discover how SAP Anywhere can help customers enable high profitability with low investment.',1456716600,1456718400,0,'session/sme.png'),(27695,'Developer Faire','HANA, HCP & Cloud Infrastructure','11:30 - 12:00','Developer Faire 4','Real-Time Movie Ratings on SAP HANA','Demonstrate a smart application that leverages the power of SAP HANA text analysis. This application is a native SAP HANA application which was developed with SAP HANA XS. It crawls movie metadata from the Rotten Tomatoes Web site and movie comment tweets from Twitter into SAP HANA in real time. At the same time, SAP HANA text analysis is used to analyze those tweets to detect what people are saying and to gauge their feelings about the movie, such as positive, neutral, or negative. The application comes in two versions, one for desktop, the other for mobile.',1456716600,1456718400,0,'session/han.png'),(27696,'Developer Faire','HANA, HCP & Cloud Infrastructure','13:00 - 13:30','Developer Faire 4','Introduction to SAP HANA Vora','In this session we introduce you to SAP HANA Vora, explaining what it is, exploring the difference between SAP HANA Vora and SAP HANA, and describing the integration between the two. We also show how SAP HANA Vora works together with Hadoop and Spark.',1456722000,1456723800,0,'session/han.png'),(27698,'Downtown Block','Small & Medium Enterprises','16:00 - 16:30','Downtown Block 3','Booming Your Business with Digital and Social Marketing in SAP Anywhere','With SAP Anywhere, the small and medium enterprise is able to increase business using most popular Social media services across and do sentiment analysis by employing the power of SAP HANA. The Cloud-based digital marketing solution will accelerate and expand business on social media and engage customers with great experience and in the most responsive way.',1456732800,1456734600,0,'session/sme.png'),(27699,'Interactive Zone','S/4HANA','11:30 - 12:10','5C Interactive Zone2','End-to-End Extensibility in SAP S/4HANA','This session explores the concept of enhancement for a simplified suite with a focus on cloud and software-as-a-service deployment. Extensibility is an important cloud quality. In SAP Business ByDesign, 64% of tenants have extensions. Extensibility is a major cost driver. Learn how you can significantly reduce TCO for extensibility and increase homogeneity and coverage of extensibility techniques.',1456716600,1456719000,0,'session/s4h.png'),(27726,'Developer Faire','Small & Medium Enterprises','13:00 - 13:30','Developer Faire 2','Interactive Analysis: New Excel-Based Reporting Tool for SAP Business One','During this session, explore how Interactive Analysis 2.0, a new Excel-based reporting tool, combines the power of the report designer and the standard Excel features. The tool enables broader users, not only IT specialists, to design full-featured reports efficiently and quickly. Built on top of the SAP Business One semantic layer, the tool leverages the SAP HANA platform to analyze Big Data and run reports on high speed.',1456722000,1456723800,0,'session/sme.png'),(27780,'SAP Talk','LoB Applications','13:00 - 13:20','5F Yangtze Rive Hall','SAP Hybris: Customer Engagement Center','The Customer Engagement Center (CECenter) for SAP Hybris is a newly developed application based on SAP Hybris as a Service on SAP HANA Cloud Platform. In this session, explore how the CECenter enables customers to provide real time customer omnichannel engagement with integrated communications stack, including peer-to-peer video chat and social media.',1456722000,1456723200,0,'session/lob.png'),(27798,'Developer Faire','S/4HANA','14:30 - 15:00','Developer Faire 4','SAP Fiori Order Management Apps on Core Data Services in SAP S/4HANA','Core Data Services (CDS) modeling, built on top of the SAP S/4HANA database model, aims to serve as a meta-model for acquiring real-time insight and getting the full potential of in-memory technology. In this session, we introduce the advantage of CDS, comparing it with the previous virtual data model (VDM) based on calculation views. The development model and process are also shared in this session, in which we discuss SAP Fiori sales order fulfillment and smart business apps, built on top of the CDS modeling, providing analytical services and transactional services for order management in one application. We also share the design and implementation for analytical and transactional usage of CDS modeling.',1456727400,1456729200,0,'session/s4h.png'),(27808,'Interactive Zone','S/4HANA','11:30 - 12:10','5D Interactive Zone3','How to Implement SAP S/4HANA: Build Smart, Run Simple','Find out how to get started on an implementation of SAP S/4HANA with fully configured software and ready-to-run business processes based on SAP Best Practices. Accelerate time to value with preconfigured business processes, integration, and migration best practices. Learn how to get a jump-start for your deployments, in the cloud and anywhere.',1456716600,1456719000,0,'session/s4h.png'),(27809,'Downtown Block','HANA, HCP & Cloud Infrastructure','13:00 - 13:30','Downtown Block 2','SAP S/4HANA Migration and Upgrade Paths','In this session we give you an insight into migration paths to SAP S/4HANA, which is the next-generation business suite from SAP. We sketch the concepts for the initial data load into the different deployment options for SAP S/4HANA.',1456722000,1456723800,0,'session/han.png'),(27815,'Developer Faire','S/4HANA','15:30 - 16:00','Developer Faire 5','SAP HANA Cloud Integration Technology in SAP S/4HANA ','SAP S/4HANA natively integrates with all product editions of SAP',1456731000,1456732800,0,'session/s4h.png'),(27854,'Developer Faire','Internet of Things','11:30 - 12:00','Developer Faire 6','Connected Fleet: A Practical Co-Innovation Project','Connected Fleet is an IoT-based co-innovation project. Utilizing the data collected from vehicle terminals, the project mainly focuses on the fuel consumption analysis and driving behavior analysis for a concrete mixer truck. The project is aimed at reducing fuel consumption and improving driving safety. In this session we will introduce the business background and the solution, then we will demonstrate the proof of concept. \r',1456716600,1456718400,0,'session/iot.png'),(27898,'SAP Talk','HANA, HCP & Cloud Infrastructure','11:30 - 11:50','3F Yellow River Hall','Cloud Integration: An Update on Our Strategy','Integration is a top concern for companies embarking on their cloud journey. In fact, many organizations have invested years and money to connect their on-premises landscapes. They expect continuity and nondisruption as they anticipate and adopt cloud innovation from SAP. This session outlines our strategy for cloud integration and provides a current status of our cloud integration portfolio with a focus on SAP HANA Cloud Integration technology.',1456716600,1456717800,0,'session/han.png'),(27911,'SAP Talk','User Experience','13:20 - 13:40','3F Yellow River Hall','The Product Strategy for SAP Fiori','What is SAP doing to make SAP Fiori UX successful overall? More than you might think _ which is why it',1456723200,1456724400,0,'session/ue.png'),(27981,'Developer Faire','Analytics','11:30 - 12:00','Developer Faire 1','Predictive Forecasting','Big Data and the various methods for analyzing it has been a hot topic in recent years. SAP provided a great example of data analysis with the SAP HANA platform for the 2014 FIFA World Cup. Now, we believe it',1456716600,1456718400,0,'session/ana.png'),(28069,'Developer Faire','S/4HANA','14:30 - 15:00','Developer Faire 7','End-to-End Implementation Experience for Hierarchy in SAP Fiori','Hierarchy in SAP Fiori is a hot and important topic. Hierarchy is used widely in customers',1456727400,1456729200,0,'session/s4h.png'),(28079,'Developer Faire','HANA, HCP & Cloud Infrastructure','13:30 - 14:00','Developer Faire 4','SAP HANA Cloud Platform Development Experience','SAP HANA Cloud Platform is an in-memory cloud platform for today',1456723800,1456725600,0,'session/han.png'),(28103,'Interactive Zone','Analytics','13:50 - 14:30','5C Interactive Zone2','SAP Lumira, Server Version for the SAP BusinessObjects BI Platform: Functional and Hands-On Session','In this session, we discuss the new features and capabilities of SAP Lumira, server version for the SAP BusinessObjects BI platform. We cover an end-to-end workflow, starting from an analyst creating documents with SAP Lumira to then saving them from the desktop to the server version of SAP Lumira for the SAP BusinessObjects BI platform. We also conduct a hands-on portion of the session.\r',1456725000,1456727400,0,'session/ana.png'),(28114,'Downtown Block','Internet of Things','13:30 - 14:00','Downtown Block 3','End-to-End IoT Architecture in the Ecosystem and SAP','In this session, we will discuss the IoT architecture at SAP and relevant products across the company. We will share how SAP collaborates with partners and is building the IoT ecosystem. ',1456723800,1456725600,0,'session/iot.png'),(28127,'Developer Faire','Security & Engineering Excellence','11:30 - 12:00','Developer Faire 5','Are You an Open Source Contributor? How Can You Add More Value?','Many developers at SAP work on open-source projects, either as part of their daily job or because they enjoy contributing to projects started by others. The SAP tools team and the SAP outbound open source team are trying to understand how both scenarios currently work and which suggestions active contributors may have to encourage more SAP presence in open source activities. This session showcases first findings of our user research at SAP, as well as a high-level idea for a new tooling approach to support more open-source activity. Join us for a few minutes to share your thoughts and ideas. We are looking forward to meet you.',1456716600,1456718400,0,'session/see.png'),(28138,'Developer Faire','User Experience','11:30 - 12:00','Developer Faire 7','Extending SAP Fiori Apps to Apple Watch Using the Hybrid App Toolkit Add-On for SAP Web IDE','In this session, we start by examining the challenges that Apple Watch has brought to the app development landscape; then we review a few major solutions and frameworks that can help tackle those challenges. Next, and most importantly, we reflect on SAP mobile app development practices to understand SAP',1456716600,1456718400,0,'session/ue.png'),(28140,'Developer Faire','Industry Applications','11:30 - 12:00','Developer Faire 3','User Interface 5 Gantt Chart Control','Gantt charts are state of the art for various application domains, in particular for planning and scheduling. For example, in resource-based planning, a Gantt chart can show the plan in an intuitive graphical fashion, create visibility on resource availability, and allow for monitoring of plan execution _ as well as interactive planning through drag-and-drop methods. In project management, in can display the project structure in a hierarchical way, including milestones and relationships between activities. More than 30 applications and projects within SAP need a UI5 Gantt chart control. These charts are designed to enable later reuse by other applications. Get details on the developed UI5 chart control and how it can be consumed by first adopters and the SAP Transportation Management and the SAP Portfolio and Project Management applications.',1456716600,1456718400,0,'session/ia.png'),(28152,'Developer Faire','S/4HANA','14:30 - 15:00','Developer Faire 5','Transform Global Finance Reporting in the Cloud with SAP S/4HANA','Transform financial reporting by making use of the latest tools and technology in SAP S/4HAHA. These highly efficient tools offer superior usability and analytics functionality for delivering reports, along with optimal extensibility for customers.',1456727400,1456729200,0,'session/s4h.png'),(28155,'Developer Faire','Internet of Things','13:00 - 13:30','Developer Faire 6','Machine Learning for Predictive Maintenance and Service','In predictive maintenance and service quite a few predictive models are utilized to mine the insights from the massive amount of data. In this session, we will share typical use scenarios from customer innovations using machine learning techniques. These use cases include rare events classification, anomaly detection, and Big Data visualization. We will discuss problems, architecture, challenges, learnings, and solutions. ',1456722000,1456723800,0,'session/iot.png'),(28170,'Developer Faire','Small & Medium Enterprises','13:30 - 14:00','Developer Faire 2','SAP Anywhere: Using Docker for Fast and Simplified Deployment of Cloud Solutions','This session introduces how Docker, an open platform for developers and system administrators to build, ship, and run distributed applications, can help development teams to simplify development and cloud operations. Watch a demo showing how the CSM-based Docker manages the full landscape, include basic infrastructure services, app services, databases, load balance, failover, upgrades, and more. Interested attendees can deploy their own Web application through CSM on the spot.',1456723800,1456725600,0,'session/sme.png'),(28173,'Developer Faire','Security & Engineering Excellence','13:00 - 13:30','Developer Faire 5','Continuous Delivery In SAP Anywhere: How-Tos And Best Practices','Consider continuous delivery (CD), a set of practices and principles in software engineering aimed at building, testing, and releasing software, faster and more frequently. This session presents how CD principles were introduced and applied by the development group for in SAP Anywhere. Learn how to set up CD functionality on top of various tools along with best practices of applying CD.',1456722000,1456723800,0,'session/see.png'),(28185,'Downtown Block','Analytics','11:30 - 12:00','Downtown Block 5','Experience the Simplicity of SAP Cloud for Analytics for Planning','Get hands-on experience with the SAP Cloud for Analytics for planning solution. Experience a new way of conducting collaborative business-planning and decision-making processes.\r\r',1456716600,1456718400,0,'session/ana.png'),(28188,'Developer Faire','Analytics','13:00 - 13:30','Developer Faire 1','New-Generation Consolidation Solutions: Embedded Model of SAP Business Planning and Consolidation','Join us for a first-time introduction to our new consolidation solution. Release 10.1 of SAP Business Planning and Consolidation, version for SAP NetWeaver, now offers a new embedded model. In this session, we present the product details with a focus on consolidation and end-to-end modeling capabilities.\r',1456722000,1456723800,0,'session/ana.png'),(28193,'SAP Talk','Analytics','14:40 - 15:00','3F Yellow River Hall','Leveraging Key Technology Trends to Build Next-Generation Solutions in the Cloud','In this session, we use SAP Cloud for Analytics as a case-study example to illustrate the importance of leveraging key technology trends when building next-generation solutions in the cloud.\r',1456728000,1456729200,0,'session/ana.png'),(28195,'SAP Talk','Small & Medium Enterprises','14:00 - 14:20','3F Yellow River Hall','Microservice-Oriented Architecture to Build SME SaaS','Consider SAP HANA Cloud Platform, the center of SAP cloud platform strategy, as the foundation of a financial SaaS solution to fully leverage the platform capabilities provided by SAP HANA Cloud Platform and SAP HANA. To optimize flexibility and scalability, microservices architecture is becoming more popular in the SaaS world. Through the architecture design process, transaction management, and services collaboration, explore how some difficult challenges can be solved in different ways.',1456725600,1456726800,0,'session/sme.png'),(28281,'Developer Faire','S/4HANA','15:30 - 16:00','Developer Faire 6','User Assistance: From Onboarding to Expert','Integrated, cloud-based user assistance (UA) gets your product',1456731000,1456732800,0,'session/s4h.png'),(28287,'Downtown Block','Small & Medium Enterprises','15:30 - 16:00','Downtown Block 2','SAP Business One on SAP HANA: Business Intelligence and Predictive Capabilities for Small Businesses','Leverage the predictive capabilities in the SAP HANA platform. Use SAP Business One powered by SAP HANA to create a new paradigm for applying predictive capabilities in ERP systems for small and midsize businesses. We have intelligent forecast in MRP, ABC analysis/RFM (clustering) analysis in pervasive analytics for customer analysis, and the intelligent recommendation engine and customer churn analysis in SAP 360 Customer solution.',1456731000,1456732800,0,'session/sme.png'),(28534,'SAP Talk','S/4HANA','13:00 - 13:20','3F Yellow River Hall','SAP S/4HANA Embedded Analytics _ How KPIs and Reports Are Embedded into SAP Fiori UIs ','Embedded analytics in SAP S/4HANA is key to bringing the relevant information to the UI where the job gets done and where decisions are taken. A joint project evaluated how our current analytics vocabulary serves an annotations-based programming model within SAP Fiori. The team took a typical business scenario in financials and tried it out. In this presentation you can not only see the results of this proof of concept but you can also understand how analytical assets such as KPIs and reports can be expressed with annotations and reused in multiple SAP Fiori UIs such as object page and overview page. These results were achieved by the embedded analytics semantic infrastructure team, representing financials, suite architecture, frontrunner applications, enterprise analytics, and other areas of specialty.',1456722000,1456723200,0,'session/s4h.png'),(28726,'Developer Faire','HANA, HCP & Cloud Infrastructure','14:00 - 14:30','Developer Faire 4','Core Data Services Natively Integrated in SAP HANA','Core data services (CDS), a high-level program model beyond SQL, is now natively integrated into the SAP HANA SQL engine. General CDS concepts such as calculated field, associations, and infix filter can be defined and performed by SQL-like language instead of using interfaces provided by different modules such as ABAP, SAP HANA XS, or RDL. By using native CDS to manipulate data, developers for SAP HANA can focus on their code logic instead of paying attention to complex SQL principles. Also, because a CDS query is sent directly to the SQL engine, it avoids overhead produced by other modules, providing an intuitive way for users to develop an application both in the design and debug phases. Other CDS features, such as annotation and aspects, are on the way to being integrated in the SAP HANA SQL engine. All of these features are intended to enrich SQL grammar so that users can easily and productively write SQL statements in their application.',1456725600,1456727400,0,'session/han.png'),(28727,'Developer Faire','Small & Medium Enterprises','14:00 - 14:30','Developer Faire 2','O2O Scenarios with OMS in SAP Anywhere','This session presents how the SAP Anywhere solution can provide various omnichannel, online to offline (O2O) scenarios for customers, which can lead to more business benefits. Join the discussion of these major cases: 1. Buy through an online e-shop or marketplace platform, and pick up in the real store. 2. Redeem a marketplace coupon in a physical store. 3. Use the social marketing and transaction in the Wechat messaging and calling app.',1456725600,1456727400,0,'session/sme.png'),(28746,'Developer Faire','Industry Applications','13:00 - 13:30','Developer Faire 3','SAP Real Estate Residential solution ','The solutions delivered by SAP to residential real estate customers fully meet client needs and are now competitive in China. Residential real estate solutions from SAP contain project system finance, cost, contact management, and sales. Learn how these solutions are running and examine special processes related to the residential real estate industry.',1456722000,1456723800,0,'session/ia.png'),(28752,'SAP Talk','Industry Applications','11:50 - 12:10','5F Yangtze Rive Hall','Enjoy a Green Supply Chain with the SAP Environment, Health, and Safety Management Application','SAP delivers a whole package of solutions to support a green supply chain and a safe clean, environment _ all of which has become important to Chinese citizens. The SAP Cloud for Product Stewardship solution from SAP Environment, Health, and Safety Management (SAP EHS Management) can play an active role in the supply chain. Everyone including individuals, managers, and enterprise owners can benefit from such solutions. Be part of a green, safe, sustainable future by understanding SAP EHS management and related software.',1456717800,1456719000,0,'session/ia.png'),(28758,'Developer Faire','Internet of Things','13:30 - 14:00','Developer Faire 6','Details on the Zoomlion Co-innovation Architecture and Implementation','This session provides an in-depth review of the Zoomlion co-innovation project. We will focus primarily on oil consumption analysis, driver behavior analysis, and other features of the project. The solution architecture covers vehicle hardware, analytics in the SAP HANA application, and more. We will also discuss some insights we have discovered that will be considered for the next iteration of this project.',1456723800,1456725600,0,'session/iot.png'),(28813,'Downtown Block','Internet of Things','14:00 - 14:30','Downtown Block 3','Introduction to SAP Predictive Maintenance and Service','In this session, we will introduce the SAP Predictive Maintenance and Service solution, including overall background, functionalities, and typical use cases. We will also discuss the SAP Predictive Maintenance and Service engagement in greater China, including customer success stories and more. ',1456725600,1456727400,0,'session/iot.png'),(28833,'Downtown Block','Internet of Things','14:30 - 15:00','Downtown Block 3','Connected Fleet: IoT for Fleet Management Solutions','In this session, we will introduce an IoT-based fleet management solution - Connected Fleet. By monitoring and analyzing real-time data collected from vehicle terminals, Connected Fleet helps to realize flexible production, reduce fuel consumption, and improve driving safety. In this session we will discuss the focused industries, the market opportunity, and the business value of Connected Fleet. In addition, by focusing on the ready-mix concrete industry, we will demonstrate the features and use cases of Connected Fleet. We will also discuss the co-innovation progress with potential customers on this project.',1456727400,1456729200,0,'session/iot.png'),(28878,'Developer Faire','Analytics','13:30 - 14:00','Developer Faire 1','Common Visual Object Modeler (CVOM): What','Learn how the CVOM visualization series helps you visualize your data with a state-of-art, extensible, HTML5-based visualization library. In this session, we share and demonstrate some of the latest achievements in the field of HTML5 visualization. This includes, but is not limited to, the highly customizable and interactive chart library, geo map analysis, and the VizContainer. We also introduce you to the latest progress in CVOM integration with SAP Fiori UX, SAP HANA platform, SAP Lumira software, and cloud.\r',1456723800,1456725600,0,'session/ana.png'),(28890,'Developer Faire','LoB Applications','15:30 - 16:00','Developer Faire 8','SAP SuccessFactors: OData API Insights and Best Practices','The session illustrates the latest architectural design and highlighted features in the BizX OData API framework, including next-generation multilevel metadata construction, autogenerating reverse navigation, API auditing and throttling through Apigee, and SAPUI5 native support. Explore best practices in implementing new OData entities and functions using the API framework with its extensive and comprehensive capabilities.',1456731000,1456732800,0,'session/lob.png'),(28895,'SAP Talk','Security & Engineering Excellence','15:50 - 16:10','3F Yellow River Hall','Quality: Where Are We headed? SAP Quality Initiative 2016','How do our customers perceive quality? Do we at SAP still execute the ',1456732200,1456733400,0,'session/see.png'),(28906,'Developer Faire','Security & Engineering Excellence','13:30 - 14:00','Developer Faire 5','SAP Hacker Announcements for 2020: Getting SAP Recognition for Security in the Cloud and Beyond','Supporting our 2020 strategy, new SAP solutions driven by IoT, business networks, cloud, and SAP HANA technologies leverage customer data to develop innovative business opportunities with cloud, hybrid and on-premise deployments. Managing software vulnerabilities and high security levels are critical success factors that can make or break our business ambitions. Security events from 2015 already showcase hackers\' damage potential, institutional lapses leading to hacking on a mass scale, challenges in coordinating vulnerability disclosures, and complexities in securing the cloud against hacking and data breaches. Join this session for PSRT expert interaction and an in-depth look at the latest SAP vulnerability trends. You can to learn how to effectively protect customers, products, solutions, and services for responsible vulnerability disclosures, and how to contribute to SAP product security as a competitive differentiator.',1456723800,1456725600,0,'session/see.png'),(28925,'Downtown Block','Industry Applications','14:00 - 14:30','Downtown Block 5','Provide the Best Patient Experience Through Service Excellence','Healthcare is changing from a local care delivery approach to care across boundaries. At the same time, providers face tight hospital budgets, increasing healthcare delivery costs, and declining revenue. This has led to more competition for patients among healthcare providers. The SAP Patient Relationship Management solution integrates the SAP Customer Relationship Management application with the SAP Patient Management application. SAP Patient Relationship Management helps healthcare providers attract new patients and maintain long-lasting relationships. Learn why the solution has become such a hot topic and how it can help healthcare providers win against the competition.\r',1456725600,1456727400,0,'session/ia.png'),(28931,'Downtown Block','Security & Engineering Excellence','11:30 - 12:00','Downtown Block 3','I Use Open Source: Is My Software Less Secure Now?','Usage of open source software in SAP products is increasing. Unfortunately, security vulnerabilities, such as the Heartbleed security bug, have made national headlines. Therefore, using open source software also brings an additional security challenge with it, so we must constantly look out for vulnerabilities. From the perspective of customers, it does not matter if an SAP product is compromised through a security gap in the open source part or in SAP proprietary coding. Both can lead to appalling business problems and ramifications. This session highlights challenges and responsibilities for development teams using open source software components in o products, and concludes with suggestions on how to mitigate security risks.',1456716600,1456718400,0,'session/see.png'),(28938,'Developer Faire','Industry Applications','13:30 - 14:00','Developer Faire 3','The Monitoring and Analytics of Energy Consumption in Modern Factories','Energy problems are critical throughout the world and manufacturing factories are the big energy users. Our solution allows users to monitor the amount of energy consumption and analyze the data according to different dimensions, such as time periods, plant structures, shifts, and production events. Users can also find the historical consumption of the same line and define the safety area for each individual object. The solution provides multiple notifications when an anomaly occurs. The data provides lots of information and helps users better monitor the factories and make better decisions. Meanwhile, it stores historical data for data mining and preventive maintenance. The solution can also fit in the context of Industry 4.0 and help factories run better. The data is collected through integration with data acquisition systems and sensors, and users can see clean and simple reports on a PC or mobile devices. ',1456723800,1456725600,0,'session/ia.png'),(28949,'SAP Talk','Analytics','14:40 - 15:00','5F Yangtze Rive Hall','Unleashing Big Data Value Through Analytics Solutions from SAP and the Yushanfang Data Platform','Alibaba Group launched a Big Data service called Yushanfang. Its offerings include providing copies of e-commerce data from Taobao Marketplace and Tmall.com, a Big Data cloud infrastructure for Hadoop-like data warehousing and processing, a data marketplace for selling data as tables or online services, and an app marketplace for independent software vendors (ISVs) to sell apps that consume the data. Our first step in working with Alibaba was leveraging SAP Lumira software and SAP BusinessObjects BI solutions to provide cloud-based BI services to customers wishing to analyze Big Data from Taobao Marketplace or Tmall.com. This will help customers get real insight about their stores and act accordingly to improve consumer traffic and order transactions. A similar solution could be applied to other use cases and easily accessed by customers through the public cloud. In this session, we share information about the solution, our collaboration with Alibaba, and the customers in the journey.',1456728000,1456729200,0,'session/ana.png'),(28977,'Developer Faire','User Experience','13:30 - 14:00','Developer Faire 7','Simplified Installation of SAP Fiori Apps with Maintenance Planner','SAP simplifies installation of SAP Fiori apps with integration across different tools. This seamless integration between SAP Fiori apps reference library and maintenance planner offers an integrated process to discover, explore, and install SAP Fiori apps with much greater ease and efficiency. This session walks you through the end-to-end process, explaining how the integrated process can be used for faster adoption of SAP Fiori apps. ',1456723800,1456725600,0,'session/ue.png'),(29020,'Interactive Zone','Security & Engineering Excellence','14:40 - 15:20','5D Interactive Zone3','Outbound Open Source at SAP: Current Practices, Challenges, and New Opportunities','Today, SAP and other enterprises are contributing to growth of open source software (OSS) as never before. OpenUI5 and Olingo (SAP), Linux (RedHat), OpenPegasus (Microsoft), Apache Tomcat (IBM), Web Toolkit (Google), OpenStack and CloudFoundry are just some prime examples along with millions of other OSS contributions. This interactive session focuses on outbound open source at SAP: when we contribute software to OSS projects through foundations and other public repositories such as GitHub. To maintain a credible position, we must ensure that software we contribute to OSS projects have the same quality as any other commercial solution owned by SAP, and the contributed software is secure, reliable, and compliant. Join this session to learn more about: 1. How we can contribute effectively to OSS communities to maintain SAP\' credibility. 2. How we can choose strategically specific OSS projects to positively influence future innovations and businesses.',1456728000,1456730400,0,'session/see.png'),(29021,'Interactive Zone','HANA, HCP & Cloud Infrastructure','14:40 - 15:20','5B Interactive Zone1 ','Building SAP Cloud Solutions Through OpenStack and Cloud Foundry: How to Be Compliant and Secure','As SAP and its partners embrace cloud computing to differentiate themselves with customers and capture new opportunities, it becomes increasing important to develop affordable yet complete and flexible cloud-based solutions rapidly, consistently, and reliably. OpenStack and Cloud Foundry, which are based on open-source software, are helping SAP and its partners achieve that goal. However, several compliance, security, and product management challenges must be overcome to achieve the goal. In this interactive session, we share our plans for helping various SAP stakeholders overcome these challenges in order to maximize the benefits of SAP cloud solutions built on top of OpenStack and Cloud Foundry. In particular, we demonstrate some innovative solutions that we are developing to manage the compliance and security risks in OpenStack and Cloud Foundry so that we can achieve the goals of delivering cloud-based solutions rapidly, consistently, and reliably.',1456728000,1456730400,0,'session/han.png'),(29038,'Developer Faire','Industry Applications','14:00 - 14:30','Developer Faire 3','Intelligent Reminder Based on a Code Inspector','Currently, the Beijing Insurance development team works on standard development in FS-PM, where the original language is German. Therefore, several language translation steps have to be added into standard development procedure. These extra steps increase developers',1456725600,1456727400,0,'session/ia.png'),(29047,'Developer Faire','LoB Applications','14:00 - 14:30','Developer Faire 8','SAP Runs SAP: Cloud for Customer','SAP IT has been a consistent, early adopter of SAP software innovations as the first and most trusted customer. Starting the journey in a very early stage, SAP IT and GCO teams have been at work on the SAP Cloud for Customer solution and mobile app for more than two years, working closely with the development team on product improvement, delivery, and operating processes. In this session, we intend to share IT internal landscape and infrastructure set up, business use cases, development process, and a demo of functionalities.\r',1456725600,1456727400,0,'session/lob.png'),(29087,'Interactive Zone','LoB Applications','13:00 - 13:40','5C Interactive Zone2','SAP Integrated Business Planning: Walk Through','SAP has added a number of functionalities and features to SAP Integrated Business Planning (IBP), all of which make the solution more attractive customers. These benefits include: SAP Fiori apps for IBP, adoption of the user and authorization management framework in SAP NetWeaver, a new algorithm to support short-term demand management, inventory planning that optimizes target stock plan and customer service levels, and an allocation planning run to serve customer orders\' availability-to-promise (ATP) check. Explore these new features in this interactive zone session discussions and an interactive demo.',1456722000,1456724400,0,'session/lob.png'),(29088,'SAP Talk','Internet of Things','15:30 - 15:50','3F Yellow River Hall','IoT Challenges and Opportunities in China','In session, we will discuss the market and trends for the Internet of Things (IoT) and three key ongoing IoT projects in China. We will also share the challenges that we are facing with the IoT and suggest actions for promoting and dealing with IoT projects for Chinese customers.  ',1456731000,1456732200,0,'session/iot.png'),(29104,'SAP Talk','LoB Applications','13:20 - 13:40','5F Yangtze Rive Hall','Integrated Business Planning on SAP HANA to Optimize Supply Chain Planning','Supply chains have become more volatile due to major geographic and demographic trends and challenges. Market power has shifted toward consumers making purchases in real time and expecting quick delivery. Logistics requirements are becoming increasingly complex because of constantly changing logistical demand across distribution networks. Planning systems disconnected from execution systems result in a breakdown of closed-loop processes, and logistical decisions are being made without real-time information. Integrated business planning (IBP) can address these challenges to help businesses gain advantage by becoming more agile and benefiting from changes in demand to meet customer expectations reliably. See how IBP can align key stakeholders in a unified model of demand, supply chain, and financial data for real-time analysis and simulation, providing end-to-end visibility and monitoring.',1456723200,1456724400,0,'session/lob.png'),(29105,'Developer Faire','Industry Applications','14:30 - 15:00','Developer Faire 3','Mr.Booker: Meeting room booking system based on IoT','Help an individual user search and book meeting rooms efficiently. Improve meeting room allocation by supplying related use data to help faculty departments optimize the meeting room resource. ',1456727400,1456729200,0,'session/ia.png'),(29111,'Developer Faire','Industry Applications','15:30 - 16:00','Developer Faire 3','Big Data in Manufacturing','In model production lines, more and more sensors are used in machines, and more pieces of data need to be collected in manufacturing systems. The SAP Manufacturing Execution application runs with the SAP HANA platform to handle Big Data and can respond to machines quickly. New real-time reports are built on SAP HANA to provide insights during manufacturing. Gain knowledge of SAP Manufacturing Execution and SAP HANA.\r',1456731000,1456732800,0,'session/ia.png'),(29112,'Developer Faire','Internet of Things','14:00 - 14:30','Developer Faire 6','The Role of SAP Manufacturing Execution in Supporting Industry 4.0 ','The SAP Manufacturing Execution application plays an important role in creating an Industry 4.0 Factory. Master data from the SAP ERP application can be maintained in SAP ERP and transferred to SAP Manufacturing Execution. SAP Manufacturing Execution interacts with machines through the SAP Manufacturing Integration and Intelligence application and the SAP Plant Connectivity software. Industry 4.0 functions in SAP Manufacturing Execution such as substep, site point, visual test, and repair are valuable to fulfill the Industry 4.0 use case.\r\rThis session will describe the role SAP Manufacturing Execution plays in the smart manufacturing structure and demonstrate how the application',1456725600,1456727400,0,'session/iot.png'),(29113,'Developer Faire','Security & Engineering Excellence','14:00 - 14:30','Developer Faire 5','Elastic Scan: Freestyle Code Scan with Just One Click','Still tormented by annoying dependencies and configurations for your test environment? Tired of mechanical operations and the black console window? Feeling desperate after spending a whole week on code scanning, encountering out-of-memory errors? Good news _ things have changed with the help of Monsoon, SAP IT',1456725600,1456727400,0,'session/see.png'),(29134,'SAP Talk','Security & Engineering Excellence','14:20 - 14:40','5F Yangtze Rive Hall','Innovation and Agility for SAP','Customers of on-premise software take three years on average to adopt SAP',1456726800,1456728000,0,'session/see.png'),(29143,'Developer Faire','User Experience','14:00 - 14:30','Developer Faire 7','Eliminate the Table: Visualize Your Business Data with SAP Fiori','Visual 2D and 3D interactive graphics and maps play an extremely important role in our daily lives _ and more than you would expect. This goes beyond just the road map and GPS in our cars. SAP Visual Business with SAP 3D Visual Enterprise visualizes and combines enterprise data with geographical, analytical, and 3D real-world scenes. It can both display information and transact with back-end systems while providing a graphical representation of data and is fully integrated with major UI frameworks such as SAPUI5 or Web Dynpro ABAP, floorplan manager, and CRM Web client UI framework.\r',1456725600,1456727400,0,'session/ue.png'),(29161,'Downtown Block','User Experience','14:30 - 15:00','Downtown Block 2','Develop Apps with SAP Web IDE, Hybrid App Toolkit Add-On','In this session, learn how to build a mobile application, styled like an SAP Fiori app, from scratch using the SAP Web IDE, hybrid app toolkit add-on. Learn to add mobile-specific features to the app, and deploy the app to a mobile device. The session also covers configuring the connectivity using SAP HANA Cloud Platform mobile services.',1456727400,1456729200,0,'session/ue.png'),(29176,'Developer Faire','S/4HANA','15:30 - 16:00','Developer Faire 7','How to Build a Localization SAP Fiori App in SAP S/4HANA','Attend this session to see a demo of the best practice for building a localization SAP Fiori app in SAP S/4HANA.',1456731000,1456732800,0,'session/s4h.png'),(29194,'Developer Faire','Industry Applications','14:00 - 14:30','Developer Faire 1','Modern SAP Fiori Apps for an Insurance Portal and Workplace Solution','Insurance is redesigning and enriching its industry solution portfolio to better satisfy fast-changing market demands and help insurance companies win in the digital era. By becoming a part of this journey, SAP is developing an insurance portal and workplace solution to renovate core insurance solutions with a unified user experience like the one SAP Fiori apps customers enjoy. See an introduction of the development snapshot of this solution. Experience SAP Fiori and share and discuss how it helps simplify complex insurance solutions while easing the daily life of insurance users.',1456725600,1456727400,0,'session/ia.png'),(29199,'SAP Talk','HANA, HCP & Cloud Infrastructure','15:50 - 16:10','5F Yangtze Rive Hall','Overview of SAP HANA Cloud Platform','Have you heard the buzz about SAP HANA Cloud Platform? Do you want to learn more about what it is and what it means for you? Then join us in this session. We introduce you to the platform and explain what it is and what it isn',1456732200,1456733400,0,'session/han.png'),(29200,'Cloud Innovation Kitchen','Security & Engineering Excellence','15:00 - 16:00','3F Cloud Innovation Kitchen','Cloud Curriculum: Highway to the Cloud','This session introduces the new cloud curriculum for development. Learn about training and coaching offerings available to help your team and you get ready for development in the cloud. Look into various modules of the curriculum, including cloud basics and culture, microservices, continuous delivery, and DevOps. Get an introduction to self-study opportunities you can apply directly in your everyday work. Learn from pilot team members about their learning experiences and how they have benefited from coaching to make a smooth transition to the cloud.',1456729200,1456732800,0,'session/see.png'),(29202,'SAP Talk','Incubation & Emerging Trends','14:20 - 14:40','7F Pearl Hall','Gamification: Foster Inspiration and Innovation While Meeting Development Deadlines','In the world of challenging development releases, how do we find a way to inspire new ideas and creativity? Already stressed by time and capacity, how do we create a culture and environment for innovation? To fuel our digital transformation, we need highly motivated and engaged teams. How do we strive for process excellence and innovation while having fun? Gamification! We designed and implemented a gamification concept with our MFG/PLM teams, known as ',1456726800,1456728000,0,''),(29203,'Cloud Innovation Kitchen','Security & Engineering Excellence','13:00 - 14:00','3F Cloud Innovation Kitchen','Design Thinking: Inspiring the Right Solutions for the Cloud','Find out how the practice of design thinking, since its broad introduction in 2012, has changed the cultural behavior inside SAP. Adopted on top agile software development practices, design thinking has developed from a creative technique into a driver for corporate change. Achievements have been determined primarily in improvements in the working culture and in the efficiency of innovation processes. In this session, we share stories on how to leverage design thinking to foster innovation and develop desirable applications _ and why applying design thinking matters even more for the cloud.\r',1456722000,1456725600,0,'session/see.png'),(29204,'Cloud Innovation Kitchen','Security & Engineering Excellence','14:00 - 15:00','3F Cloud Innovation Kitchen','Business Model Design and Innovation _ Reinventing Business Models for the Cloud Using BMDI','When you are developing for the cloud, product design and business model design need to go hand-in-hand. While design thinking focuses on desirability, business model description, design, and testing approaches concentrate on viability in order to find a proper business model for applications and services being developed. SAP',1456725600,1456729200,0,'session/see.png'),(29205,'Developer Faire','LoB Applications','14:30 - 15:00','Developer Faire 8','SAP','This session presents SAP',1456727400,1456729200,0,'session/lob.png'),(29206,'SAP Talk','S/4HANA','14:20 - 14:40','3F Yellow River Hall','S/4 HANA Learning Evolution In Digital Age','The digital age marks a new era for the business world _ one defined by constant change and innovation. Can you imagine any business surviving in this era without learning? SAP intends to transform the corporate learning experience in the digital age _ into learning without limits. Join us to gain insight into how learning is evolving to meet learners',1456726800,1456728000,0,'session/s4h.png'),(29213,'Downtown Block','Industry Applications','14:30 - 15:00','Downtown Block 5','Achieving a Foundation for Health and Personalized Medicine with the SAP HANA Platform','Hear how using the SAP HANA platform in healthcare enables personalized medicine. Get an overview of SAP',1456727400,1456729200,0,'session/ia.png'),(29229,'Interactive Zone','LoB Applications','14:40 - 15:20','5C Interactive Zone2','Omnichannel Shopping Experience Using SAP Hybris Solutions','In this session, explore how omnichannel shopping using SAP Hybris solutions integrates with Chinese popular local platforms WeChat, China',1456728000,1456730400,0,'session/lob.png'),(29231,'Developer Faire','LoB Applications','13:30 - 14:00','Developer Faire 8','Customer Engagement in SAP Hybris Marketing and WeChat','In this session, consider how SAP Hybris Marketing can provide capabilities for incorporating Chinese consumer segmentation profiles. Learn how to leverage WeChat functionalities: content library, campaign execution and feedback analytics, Shake a Shake marketing for acquisition, and the coupon offer process for recommendations.',1456723800,1456725600,0,'session/lob.png'),(29315,'Developer Faire','LoB Applications','11:30 - 12:00','Developer Faire 8','New Payroll Experience in the Cloud','Consider how the SAP Payroll Process control center is an application you can use to manage the complete payroll process. Produce high-quality results more quickly and efficiently. Managers and administrators can work closely to execute payroll process steps, implement payroll policies, monitor process status, and distribute identified issues and compliance violations to the responsible payroll administrators for correction. Payroll error functionality offers a direct entry for payroll administrators to correct employee master data and do rechecks. See how you can simplify the complex payroll process and gain a new user experience with SAPUI5. Handle Human Resources master data and payroll results using this application powered by SAP HANA and integrated with cloud solutions. ',1456716600,1456718400,0,'session/lob.png'),(29319,'Interactive Zone','Industry Applications','11:30 - 12:10','5B Interactive Zone1 ','Learn How to Implement a Portal for SAP Fiori Apps for Self-Service Scenarios','Find out how to implement SAP Fiori apps for external users such as agents and brokers in the insurance industry. Get an overview of best practices in designing and developing SAP Fiori apps for a complex landscape.',1456716600,1456719000,0,'session/ia.png'),(29345,'Downtown Block','HANA, HCP & Cloud Infrastructure','11:30 - 12:00','Downtown Block 2','Form as a Service, a Localization as a Service Application','The form template storage application is able to store XDP templates and corresponding XML content with form IDs, form locales, and form names. It allows convenient queries of templates, supports search of templates by specified property values, and enables users to preview generated PDFs. In order to achieve these goals, we maintain an SAP HANA database to store the references to templates stored in SAP HANA Cloud Platform document service, along with queryable properties such as form IDs, form locales, and form versions. The primary key of the template table is the unique object ID used to retrieve the template from document service. This expedites common queries such as a query for all available languages of the same template, in addition to supporting most of the custom queries imaginable. We have exposed an OData API for returning PDFs, which are generated by Adobe Document Services.',1456716600,1456718400,0,'session/han.png'),(29347,'Developer Faire','LoB Applications','13:00 - 13:30','Developer Faire 8','Social Media Innovation: WeChat Recruitment as Service','Human Resources departments are seeking an easier way to publish recruiting information and get access to talented prospects',1456722000,1456723800,0,'session/lob.png'),(29444,'Developer Faire','Internet of Things','14:30 - 15:00','Developer Faire 6','Project EdgeCompute: SAP HANA Cloud Platform for the Edge of the Enterprise and IoT Applications','Project EdgeCompute is the extension of capabilities of the SAP HANA Cloud Platform to a gateway device sitting close to the data source. It ingests edge data, including IoT-sensor data, and runs computation on it. These capabilities include a SQL RDBMS engine and a streaming engine, along with connectors that interface with the devices. \r\rThe goal of the project is to provide a common foundation for data acquisition, data processing, data management, device management, and security in the Internet of Things (IoT) and other widely distributed applications.\r\rCome hear about plans for this new addition to our product offering that extends the reach of SAP HANA Cloud Platform with edge computing capabilities, enabling distributed processing as part of end-to-end solutions.\r',1456727400,1456729200,0,'session/iot.png'),(29491,'Interactive Zone','Internet of Things','13:50 - 14:30','5D Interactive Zone3','SAP Translation Hub in Action','You saw it live during Bernd Leukert',1456725000,1456727400,0,'session/iot.png'),(29493,'Developer Faire','User Experience','13:00 - 13:30','Developer Faire 7','SAP Screen Personas: A Common Framework for User Interface Personalization','SAP Screen Personas software provides a common framework for personalizing user interfaces across SAP solutions and applications. Many customers personalize their SAP Fiori apps and transactions with SAP Screen Personas to improve productivity. For example, SAP Screen Personas can help end users simplify their screens by hiding unused fields, converting text entries into menu selections, and automating recurring keystrokes. With more simplified and intuitive screens, customer organizations can enhance user satisfaction, minimize training time, and reduce screen-modification costs. In this session, we demonstrate the use of SAP Screen Personas and discuss the design and technology that underpins this common personalization framework. We focus on using SAP Screen Personas to create an SAP Fiori UX-inspired experience integrated into the SAP Fiori launchpad.\r',1456722000,1456723800,0,'session/ue.png'),(29494,'SAP Talk','HANA, HCP & Cloud Infrastructure','13:40 - 14:00','3F Yellow River Hall','Business Services on SAP HANA Cloud Platform for Global Expansion','You got a preview at SAP TechEd Las Vegas in 2015. Now you get to know the inside story: the experience of ideating, implementing, and operating the next generation of business services on SAP HANA Cloud Platform. In this session we  demo the end-to-end lifecycle of a business service. Participants get insights on the microservice architecture pattern for their developments.',1456724400,1456725600,0,'session/han.png'),(29571,'Downtown Block','User Experience','13:30 - 14:00','Downtown Block 2','SAP Fiori UX, Release 2.0: The Story Behind the Red Dot','The Red Dot Award is one of the most prestigious design awards worldwide, honoring innovation, concepts, and vision. Join us to find out more about the design concepts exhibited in release 2.0 of SAP Fiori UX, which earned SAP an award in the fiercely competitive Design Concept discipline.',1456723800,1456725600,0,'session/ue.png'),(29576,'Interactive Zone','User Experience','13:00 - 13:40','5B Interactive Zone1 ','Smart Templates: Build SAP Fiori Apps Without Front-End Code','Smart templates provide commonly used application patterns according to the latest guidelines for SAP Fiori UX. To construct an SAP Fiori app, the templates, which are smart enough to understand the semantics behind the data model expressed with annotations, are applied to the data. The right combination of metadata-driven templates and freestyle programming helps you implement the defined target design. Smart templates help simplify and scale development by minimizing the amount of front-end code needed. The template approach also increases quality and consistency across SAP Fiori UX projects by supporting reuse and central design. Attend this session to get an overview of existing smart templates and their features and to learn about the road map for future enhancements.',1456722000,1456724400,0,'session/ue.png'),(29594,'Downtown Block','User Experience','14:00 - 14:30','Downtown Block 2','SAP Fiori, Cloud Edition: Addressing the Performance Challenges','When SAP Fiori apps and the SAP Fiori launchpad are moved to the cloud, they can be consumed from globally distributed end users using various device types. The back end remains on premise in the customer',1456725600,1456727400,0,'session/ue.png'),(29635,'SAP Talk','User Experience','15:30 - 15:50','5F Yangtze Rive Hall','Make Your Release Successful with the SAP Early Adopter Care Program','We have reinvented the SAP Early Adopter Care program (successor to the SAP Ramp Up and General Availability Care programs) to help our customers accelerate innovation and to help SAP software developers drive references and adoption of new releases, manage risks proactively, and build customer relationships. Attend this session to find out how you can tailor your own program according to your needs.\r',1456731000,1456732200,0,'session/ue.png'),(29993,'Downtown Block','LoB Applications','14:00 - 14:30','Downtown Block 4','Converging into the Cloud: Employee Central Payroll and the Seamless Transition to Payroll SaaS','See how SAP SuccessFactors solutions are spearheading SAP',1456725600,1456727400,0,'session/lob.png'),(30044,'Downtown Block','LoB Applications','14:30 - 15:00','Downtown Block 4','Customer Engagement and Commerce (CEC)-Based Innovations in China for China','This session introduces the newly formed Customer Engagement and Commerce (CEC) Innovation Lab China and presents a field report on its first showcase of SAP solutions and services. Hear lessons learned from and best practices for running proof of concepts and how the CEC Innovation Lab China is helping to develop innovations using the CEC portfolio in China for China.',1456727400,1456729200,0,'session/lob.png'),(30055,'Downtown Block','LoB Applications','15:30 - 16:00','Downtown Block 4','SAP Jam: Bring People, Data, and Processes Together to Drive Measurable Results','SAP has taken a unique approach to social collaboration based on three core tenets: First, collaboration needs to occur where you work with customers, partners, and employees, in your productivity and business applications, mobile apps, and social network. Second, collaboration needs to drive results to help ensure top performance. And third, collaboration needs to happen across your business network on a social platform to help ensure a simple and seamless experience. Why is this three-tiered approach optimal? Collaborative technologies have been around for a long time, but employees in organizations have not adopted them as hoped. Why? Collaboration systems have been separate from environments that most employees spend their time when working: in their productivity and business applications. This session provides an overview of how to build integration into SAP Jam to drive results for your own customers.',1456731000,1456732800,0,'session/lob.png'),(30056,'Downtown Block','LoB Applications','16:00 - 16:30','Downtown Block 4','SAP Jam Communities for SAP hybris Commerce','Companies understand that peer recommendations are a top source for the brand information that drives purchases. To generate peer-driven conversations beyond social media, companies are increasingly developing their own interactive customer communities, which provide opportunities for customer interaction in a relevant, nonpromotional setting. However, these communities are often disconnected from a brand',1456732800,1456734600,0,'session/lob.png'),(30201,'Developer Faire','Small & Medium Enterprises','14:30 - 15:00','Developer Faire 2','Actual Costing in SAP Business ByDesign','Financial functionalities in the SAP Business ByDesign solution offers key core functionalities such as controlling, parallel ledgers, and inventory management. They were strengthened in 2015 with the addition of actual costing for manufacturers, covering the full value chain from purchasing and service provisioning along a multilevel production process to finished goods. Key takeaways of this session: 1. Use SAP Business ByDesign for internal cost controlling purposes without impact on financial statements. 2. Analyze the total actual cost for all manufacturing levels using cost breakdowns for improved insight into source and nature of cost. 3. Deploy legal reporting using built-in functionality for inventory revaluation and cost-of-goods-sold (COGS) adjustment, a legal requirement in some countries such as Brazil. Highlight: See how the solution is simple to use, based on existing accounting entities and runs out of the box as part of the financial closing process.',1456727400,1456729200,0,'session/sme.png'),(30259,'Downtown Block','S/4HANA','14:00 - 14:30','Downtown Block 1','SAP S/4HANA Overview and Roadmap ','SAP S/4HANA is the next-generation business suite designed to help you Run Simple in a digital and networked world. Join this session to gain a first-level understanding of SAP S/4HANA and how we present it to the market. Learn about its business process improvements and functional scope, about the migration path to SAP S/4HANA, and about our transition utilities and tools. Join this session to understand the fundamentals of SAP S/4HANA: the why, how, and what. Hear about transition scenarios and where to find more information.',1456725600,1456727400,0,'session/s4h.png'),(30260,'Downtown Block','S/4HANA','13:30 - 14:00','Downtown Block 1','Central Finance','SAP S/4HANA Finance is the future. But how to get there given your legacy system landscape? Learn about a  nondisruptive step toward system consolidation. Find out how you can repost financial transactions into central finance in real time and harmonize data while retaining line-item detail.',1456723800,1456725600,0,'session/s4h.png'),(30261,'Downtown Block','S/4HANA','11:30 - 12:00','Downtown Block 1','Logistics in SAP S/4HANA: Key Innovations and Benefits and New Use Cases','This session explores the scope of logistics in SAP S/4HANA by answering the following questions: How will logistics address the digital transformation? What are the key innovations in logistics? What is the business value provided by logistics? We also provide use cases and discuss the road map for logistics in SAP S/4HANA.',1456716600,1456718400,0,'session/s4h.png'),(30262,'Downtown Block','S/4HANA','13:00 - 13:30','Downtown Block 1','Building SAP S/4HANA for the Cloud First','This session gives you an overview of the architecture principles for SAP S/4HANA, cloud edition, explaining why they are necessary and how they serve to ensure an ongoing simplification for SAP S/4HANA, on-premise edition as well. It helps you understand how we establish the equilibration between innovation, simplification, and compatibility, especially for SAP S/4HANA, on-premise edition.',1456722000,1456723800,0,'session/s4h.png'),(30572,'Downtown Block','Analytics','11:30 - 12:00','Downtown Block 4','Control, Prepare, and Drive Your Data with a Self-Service Tool: SAP Agile Data Preparation','In this session, we show how the SAP Agile Data Preparation application gives analysts, power users, and even data scientists the ability to easily discover, import, profile, transform, cleanse, merge, and de-duplicate data sets with push-button ease. It features a simple, intuitive spreadsheet-like UI, so users can be productive immediately. Because it is based on the SAP HANA platform, the application delivers unparalleled performance, even on huge data sets. And best of all, it goes beyond simple data preparation for analysts. It allows IT to proactively monitor data set usage and easily govern and operationalize frequently used data sets, leveraging the collective wisdom of the business to create governed analytical assets.\r',1456716600,1456718400,0,'session/ana.png'),(30573,'Downtown Block','Analytics','13:00 - 13:30','Downtown Block 4','Simplify Planning and Modeling with SAP Cloud for Analytics for Planning','See a demonstration of how you can crush complexity with the SAP Cloud for Analytics for planning solution. This session explores how SAP Cloud for Anlaytics simplifies planning and reporting. See the different ways you can automatically create a planning model, and get an overview of simple data-wrangling tools the solution provides to help you improve data quality.',1456722000,1456723800,0,'session/ana.png'),(30788,'Downtown Block','Analytics','13:30 - 14:00','Downtown Block 4','Building BI applications with SAP BusinessObjects Design Studio: What','Join this session to find out the latest news and features around using SAP BusinessObjects Design Studio to build BI applications that use data from SAP HANA platform, a BW universe, or a BI universe and that run on desktop or mobile through the SAP BusinessObjects BI platform. Plus, get a sneak preview on what is being developed for release in mid 2016 and what is planned for late 2016.\r',1456723800,1456725600,0,'session/ana.png'),(30789,'Downtown Block','HANA, HCP & Cloud Infrastructure','14:30 - 15:00','Downtown Block 1','HANA Workload Capture & Replay','HANA Workload Capture & Replay is a solution that makes the workload in the source system to be replayed in the test system. As it provides the replay of the workload with the exact sequence of SQL execution and transactions, it can be used to detect any potential issues in advance when upgrading HANA from revision x to revision y for example. Also, it provides a result comparison and a time comparison report so that DBA could easily identify the SQL statements that makes the difference.',1456727400,1456729200,0,'session/han.png'),(30790,'Downtown Block','Incubation & Emerging Trends','13:00 - 13:30','Downtown Block 5','Intrapreneurship: Create the Future and Unleash Your Inner Entrepreneur','Have you heard about SAP',1456722000,1456723800,0,''),(30793,'Downtown Block','Industry Applications','16:00 - 16:30','Downtown Block 5','Chasing a Greater Perspective by Learning from Our Customers','Where do you get new ideas for your products if you don',1456732800,1456734600,0,'session/ia.png'),(30794,'Downtown Block','Internet of Things','15:30 - 16:00','Downtown Block 3','IoT Strategy and Roadmap','The presence of IoT continues to grow in the market, and as such SAP is maturing in how we are addressing this opportunity. We have different teams creating innovative products and customers beginning to adopt these solutions, but do you fully understand our IoT strategy and corresponding roadmap? Come join us in this Downtown Block to hear more about where SAP is taking IoT, including our consolidated portfolio, customer examples, and innovative use cases.',1456731000,1456732800,0,'session/iot.png'),(30795,'Interactive Zone','Small & Medium Enterprises','13:00 - 13:40','5D Interactive Zone3','Why React is Awesome','The session introduces React, an open-source JavaScript library, and concepts, design thinking, and best practices about integrating React into existing Web projects. Consider why React provides an excellent solution for ',1456722000,1456724400,0,'session/sme.png'),(30796,'Downtown Block','Small & Medium Enterprises','15:30 - 16:00','Downtown Block 1','SECURIM, Threat Modeling, and Scanning Tools ','How would methodologies like SECURIM and threat modeling work with scanning tools like Fortify and WebInspect to generate a holistic view of the security status of a fast growing cloud solution? Join this session for a detailed discussion.',1456731000,1456732800,0,'session/sme.png'),(30797,'Downtown Block','Small & Medium Enterprises','16:00 - 16:30','Downtown Block 1','SAP Anywhere: Strategy and Road Map _ Our Journey into the New SMB Frontier','Digital transformation is happening beyond large enterprises in small and medium businesses (SMBs). End consumers change the way they interact with vendors, whether in-store or online. This enables SMBs to expand their reach to potential ens consumers via multiple channels in an unprecedented way, and at lower costs than ever before. Join this introductory session to see how SAP is integrating the online ecosystem with mobile devices and apps to deliver online to offline (O2O) solutions for small and medium businesses (SMBs), and how the IoT can provide key competitive advantage to differentiate from competitors.',1456732800,1456734600,0,'session/sme.png'),(30823,'SAP Talk','User Experience','11:30 - 11:50','5F Yangtze Rive Hall','Why We Need SAP Fiori','SAP Fiori UX is our answer to the demand for business software that has a consumer-grade user experience. How do our legacy screens differ? Which user demands are addressed? What is our approach to creating a great user experience? With release 2.0 SAP Fiori, SAP has received the Red Dot Design Award for the first time ever. SAP Fiori is the new user experience for SAP software.',1456716600,1456717800,0,'session/ue.png'),(30824,'Interactive Zone','User Experience','13:50 - 14:30','5B Interactive Zone1 ','Experience SAP Fiori UX: Take a Test Drive with the Demo Cloud Edition','Experience the new face of SAP software with the SAP Fiori, demo cloud edition. Test drive the most-used SAP Fiori apps right away. Change the look of our standard apps with your own UI theme, replace the SAP logo with your own logo, and adjust the colors of the SAP Fiori launchpad to your preferences. Adjust an existing SAP Fiori app with the connected SAP Web IDE development environment.\r',1456725000,1456727400,0,'session/ue.png'),(30929,'Developer Faire','Incubation & Emerging Trends','14:30 - 15:00','Developer Faire 1','Smart Traffic Pulse','Darmstadt is a city in the state of Hesse in Germany. In 2015, we at Nanjing Innovation Center built up a big-screen application for Darmstadt to monitor and analyze city traffic in real time by leveraging sensor data using SAP HANA. This application was shown in the Internationale Automobil-Ausstellung (IAA) 2015 in Frankfurt, where it was widely praised by the audience.',1456727400,1456729200,0,''),(31032,'SAP Talk','HANA, HCP & Cloud Infrastructure','14:00 - 14:20','5F Yangtze Rive Hall','SAP Localization Hub _ eDocuments','Building next generation business services on SAP HANA Cloud Platform for regulated eInvoicing.',1456725600,1456726800,0,'session/han.png'),(31203,'Downtown Block','Business Network Applications','13:00 - 13:30','Downtown Block 3','Concur Travel and Expense Management','Get a general introduction to the Concur Travel & Expense solution.',1456722000,1456723800,0,''),(33733,'SAP Talk','S/4HANA','14:00 - 14:20','7F Pearl Hall','Extending the Digital Core with Financial Services on SAP HANA Cloud Platform','In this session we provide insights into using SAP HANA Cloud Platform for financial services applications. We show  how easy it is to build cloud-native applications for finance and how to integrate them seamlessly with the digital core as well as the business network. We also show how partners and customers can leverage these services to integrate financial aspects into other applications using a best-of-breed approach.',1456725600,1456726800,0,'session/s4h.png'),(34205,'SAP Talk','Internet of Things','14:40 - 15:00','7F Pearl Hall','IoT - from ','Analysts believe the IoT revolution is more significant than the Internet itself.  Billions of Things connected, insight to new opportunity that is changing the world.  SAP is leading the IoT revolution, and partnering with customers to deliver outcomes they never imagined possible. Learn how SAP is helping customers during their digital transformation, and using IoT to redefine their business processes and create new business opportunity. ',1456728000,1456729200,0,'session/iot.png'),(34214,'SAP Talk','Security & Engineering Excellence','13:40 - 14:00','7F Pearl Hall','From Strategy to Execution _ Competing in the Cloud while Keeping On-Premise','Volker, head of Operations and P&I Strategy, will share the 2016 priorities and strategic implications with you. Furthermore he will give insights how P&I can successfully contribute to our customers',1456724400,1456725600,0,'session/see.png'),(34216,'SAP Talk','Security & Engineering Excellence','13:40 - 14:00','5F Yangtze Rive Hall','The Art of Being Connected','Presentation of the SAP Labs Network _ with special focus on best practice sharing in relation to development and innovation\r',1456724400,1456725600,0,'session/see.png'),(34217,'Downtown Block','Small & Medium Enterprises','13:30 - 14:00','Downtown Block 5','SAP Anywhere MTC - A Remote Mobile Test and Debug Center','In this session we will provide a brief introduction of SAP Anywhere MTC - a remote mobile test and debug center. #1. Remote control any android device and do real-time testing on more than one device, just from your browser #2. Debug Remotely in Android Studio, Chrome Debug Tools... #3. Supports typing text from your own keyboard #4. Drag & drop installation and launching of .apk files #5. Acquisition of real time logs of each device #6. Manage device inventory(See which devices are connected/offline, See who\'s using a device, Search devices by phone number, IMEI, ICCID, Android version, operator, product name) #7. User life circle management(Register, Login, Expand user trial time,  Upgrade trial user to permanent user )',1456723800,1456725600,0,'session/sme.png'),(34239,'Cloud Innovation Kitchen','Security & Engineering Excellence','16:00 - 16:30','3F Cloud Innovation Kitchen','Cloud Curriculum Applied: Developing Microservices on CloudFoundry with SAP HANA Cloud Platform','You need to develop a (Micro-)service on Cloud Foundry? This interactive session highlights some of the challenges and gives insight into the class room training that is part of the Cloud Curriculum.',1456732800,1456734600,0,'session/see.png'),(34241,'SAP Talk','Security & Engineering Excellence','11:30 - 12:10','7F Pearl Hall','SAP Business Women Network - Become a Game Changer (Panel Talk)','SAP Business Women Network - Become a Game Changer (Panel Talk)',1456716600,1456719000,0,'session/see.png'),(34243,'Customer Talk','LoB Applications','11:30 - 12:15','3B Customer Talk','Informatization to Support Sustainable Development of Sytech','SHENGYI TECHNOLOGY: Informatization to Support Sustainable Development of Sytech',1456716600,1456719300,0,'session/lob.png'),(34244,'Customer Talk','Industry Applications','13:00 - 13:45','3B Customer Talk','Westernacher and Xtep: How SAP EWM Supports Xtep to Build an Intelligent Warehouse Platform','1. Xtep EWM solution overview\r2. Xtep EWM core value\r3. Xtep EWM future roadmap\r\r',1456722000,1456724700,0,'session/ia.png'),(34245,'Customer Talk','S/4HANA','14:00 - 14:45','3B Customer Talk','Shanghai ITW Plastics & Metal: Experiences of SAP S/4HANA and SAP Simple Finance Implementation','IT director from Shanghai ITW will share the project experience about how to implement the sFIN/SoH on time on quality along with the key success factors of the project. \r',1456725600,1456728300,0,'session/s4h.png'),(34246,'Ecosystem Talk','Small & Medium Enterprises','11:30 - 12:15','3C, 3D Ecosystem Talk','Chinajey: SAP Business One Cloud Service Platform (Ningbo) ','B1 Cloud Application Innovation, and core competency introduction with current B1 Cloud market status sharing and service offering from Chinajey\r',1456716600,1456719300,0,'session/sme.png'),(34247,'Ecosystem Talk','S/4HANA','13:00 - 13:45','3C, 3D Ecosystem Talk','Accenture: SAP S/4HANA Application Innovation','SAP and Accenture S/4 HANA Business Suit Modernization\r_  History and Milestone for S/4 Fiori project\r \rAccenture S/4 HANA Implementation Experience Sharing\r_ S/4 Project Credential Introduction\r_ Key Valued added by S/4 HANA Product\r \rAccenture Fiori and Native HANA Project Experience Sharing\r_ Native HANA Project Credential Introduction\r_ Native HANA with Fiori Architecture\r_ Customer',1456722000,1456724700,0,'session/s4h.png'),(34248,'Ecosystem Talk','Business Network Applications','15:00 - 15:45','3C, 3D Ecosystem Talk','MTC: SAP Ecosystem for University Training','As the SAP China offical Education Partner & B1 Master VAR, MTC would like to share the value of SAP Learning Hub Student Eidtion & SAP Business One trainning to SAP Ecosystem, especially to the students and professors from universities.',1456729200,1456731900,0,''),(34249,'Customer Round Table','Industry Applications','11:30 - 12:15','3F Customer Round table','Co-innovating with SAP to Build Logistics Solutions on SAP HANA','Partner built an international freight and supply chain control tower solutions on top of HANA in SAP Co-Innovation Lab(COIL) , which leverage the HANA in memory technology to combine the high-volume transactions with analytic. The new solutions improve the planning capacity, end-to-end order visibility and decision making through providing transportation planning, checkpoint scheme, event tracking, exceptional management and auto alerts, real time dashboard and analytical reports. For operation, it simplifies the generation of shipping documents and automates the invoicing process.\r',1456716600,1456719300,0,'session/ia.png'),(34250,'Customer Round Table','Internet of Things','13:00 - 15:00','3F Customer Round table','Round table discussion: Industry 4.0 business and trend in China','Discuss about the current Industry 4.0 status in China and the market trend in future, also share the company strategy on Industry 4.0 from customer/partner point of view,  share the best practice and lesson learnt\r',1456722000,1456729200,0,'session/iot.png'),(34252,'Customer Round Table','HANA, HCP & Cloud Infrastructure','15:10 - 15:55','3F Customer Round table','FCaaS - fast return on investment when implementing cloud SAP','In a time with increasing focus on the speed of realizing IT investments in order to gain the expected positive out-come FIT has created a cloud based best practice ERP solution. FCaaS allows the customer to industry best practice proven SAP processes with minimum risk and fast implementation.\r',1456729800,1456732500,0,'session/han.png'),(34253,'Customer Talk','Industry Applications','15:00 - 15:45','3B Customer Talk','SAIC General Motors: SAP Extended Warehouse Management (Customer Connection Project)','Following agenda topics shall be covered:\rEWM project implementation background in SAIC-GM, the background, result, benefit and outlook of EWM customer connection project from the view of both customer and product team, besides, we will introduce the overview of customer connection program.  \r',1456729200,1456731900,0,'session/ia.png'),(34254,'Customer Round Table','Industry Applications','16:00 - 16:45','3F Customer Round table','Demand Chain and its Opportunity and Challenges in China','1  SHU.D Introduction\r2  China Supply Chain Status and Transformation\r',1456732800,1456735500,0,'session/ia.png'),(34262,'SAP Talk','Small & Medium Enterprises','13:20 - 13:40','7F Pearl Hall','Learnings from an Internal SaaS ','Key learnings and insights from building and delivering a new SaaS offering from ground up, beginning with identifying the right business opportunity and validating ideas, to agile development and continuous delivery, to reliable cloud delivery, and gaining insights of customer usage. ',1456723200,1456724400,0,'session/sme.png'),(34318,'Cloud Innovation Kitchen','Security & Engineering Excellence','11:30 - 12:10','3F Cloud Innovation Kitchen','\"Fireside Talk\" with LEAP Women and Volker Kirchgeorg','\"Fireside Talk\" with LEAP Women and Volker Kirchgeorg',1456716600,1456719000,0,'session/see.png'),(34321,'Quality Booth','Security & Engineering Excellence','11:30 - 13:00','Quality Booth','Quality Matters - Open talk about Quality@SAP','Quality Matters - Open talk about Quality@SAP',1456716600,1456722000,0,'session/see.png'),(34322,'Quality Booth','Security & Engineering Excellence','13:00 - 13:30','Quality Booth','Quality Consulting','Quality Consulting',1456722000,1456723800,0,'session/see.png'),(34323,'Quality Booth','Security & Engineering Excellence','13:30 - 14:00','Quality Booth','Guided Beta (Customer Validations)','Guided Beta (Customer Validations)',1456723800,1456725600,0,'session/see.png'),(34324,'Quality Booth','Security & Engineering Excellence','14:00 - 14:30','Quality Booth','Language Validation','Language Validation',1456725600,1456727400,0,'session/see.png'),(34325,'Quality Booth','Security & Engineering Excellence','14:30 - 15:00','Quality Booth','Corporate Requirements','Corporate Requirements',1456727400,1456729200,0,'session/see.png'),(34326,'Quality Booth','Security & Engineering Excellence','15:00 - 15:30','Quality Booth','Integration','Integration',1456729200,1456731000,0,'session/see.png'),(34327,'Quality Booth','Security & Engineering Excellence','15:30 - 16:00','Quality Booth','Open Source Governance at SAP','Open Source Governance at SAP',1456731000,1456732800,0,'session/see.png'),(34328,'Quality Booth','Security & Engineering Excellence','16:00 - 16:30','Quality Booth','Usability Validation & QG&V Service Portfolio','Usability Validation',1456732800,1456734600,0,'session/see.png'),(34332,'Ecosystem Talk','Industry Applications','14:00 - 14:45','3C, 3D Ecosystem Talk','Make IT Simple, Make Business Agile _ Huawei & SAP Co-Innovation Center ','_ Huawei ICT Strategy and Overview\r_ Huawei & SAP Co-Innovation Center Overview\r_ Huawei Solutions for SAP Global Success Cases ',1456725600,1456728300,0,'session/ia.png'),(34333,'People Booth','Security & Engineering Excellence','11:30 - 12:15','People Booth','Career Development  ',' Career Development  ',1456716600,1456719300,0,'session/see.png'),(34334,'People Booth','Security & Engineering Excellence','13:30 - 14:15','People Booth','Learning Sharing   ','Learning Sharing   ',1456723800,145672650