INSERT INTO `Survey_Info` VALUES (28895,'What does CQP stand for at SAP?','Cloud Quality Point','Customer Quality Process','Customer Quality Perception','Cloud Quality Process',3,'What is the target CQP value for 2016?','8.6','9.2','10','7.8',4,99),(34246,'How many customers does Chinajey B1 Cloud have so far?','50','200','400','800',3,'How man industry solution have been created by Chinajey B1 Cloud?','3','6','10','15',2,100),(34247,'Which kind of HANA Product is Most required in Accenture','SOH','BW on HANA','SFIN','Native HANA',3,'What Kind of Tool most needed in Accenture current project?','HANA RDS','HANA Migration Tool','NA','NA',2,101),(34248,'What kind of people is suitable to use Leraning Hub Student Edition provided by SAP','University Students','Staff','SAP Consultant','SAP Sales',1,'What is the first ERP software based on SAP HANA launched by SAP','SAP A1','SAP S4','SAP Business One on HANA','SAP By Design',3,102),(34249,'Which is not an objective of eCONNECT control tower?','Enhance planning capability','Increase supply chain visibility','Increase monitoring capability','Streamline workflow',4,'Which is not an objective of INLOG?','Streamline air freight workflow','Streamline sea freight workflow','Streamline road freight workflow','Streamline warehouse workflow',4,103),(34252,'How does FCaaS allow the implementation cycle to be so fast?','Through increase of project resources','With SAP','Through increase of project budget','By employing SAP Rapid Deployment Solutions',2,'What are the savings related with this solution?','>20% compared to traditional SAP implementation','<50% compared to traditional SAP implementation','>50% compared to traditional SAP implementation','70% compared to traditional SAP implementation',3,104),(34253,'How many improvement requests have been delivered by EWM customer connection project?','40','42','45','48',2,'Which warehouse is the first one with EWM solution go-live in SAIC-GM?','Yantai PDC','Wuhan PDC','Tianjin PDC','Shanghai PDC',3,105),(34254,'What','Reliable Supply Chain','Efficiency Supply Chain','Agile Supply Chain','Demand-Driven Supply Chain',4,'What','Logisticis','Purchasing','Planning','Customer Service',3,106),(34327,'What does TLC mean?','Technical Legal Compliance','Technical Length Compliance','Time Length Compliance','Time Legal Compliance',1,'Please name two services we GTLC team provide.','Open Source usage consult','IP Scan','Free and Open Source Request review','All the above',4,107),(29345,'How many legal forms are supported by SAP in China','20+','200+','2000+','20000+',2,'What\'s the name of CIMS provided in HCP?','Identity service','Persistence service','Connectivity service','Document service',4,108),(27798,'What is fullname of CDS','Core Data Service','Correct  Data Service','NA','NA',1,'What is the different between SOFM and SSB','SOFM is mainly for Order Monitor and SSB  is mainly for analytic','SOFM is mainly for analytic and SSB  is mainly for Order Monitor','NA','NA',1,109),(29021,'How long will it at least take for current Open Source approval process?','3 days','A week','2 weeks','A month',2,'Which one is the correct database for Froodes?','MySQL','SAP HANA','DB2','Sybase SQL Server',2,110),(27815,'Which is the correct integration service provided by SAP HCP?','SAP HANA Cloud Integration','SAP HANA Cloud Connector','SAP API Management','Both of them',4,'Which adapter not supported by SAP HCI?','Email','Facebook','JSON','IDoc',3,111),(29194,'NanShan Life adopts which SAP products?','SAP Suite','SAP ERP','SAP Successfactor','SAP JAM',2,'SAP Insurance Suite includes:','Policy Management(FS-PM)','Insurance Product Workplace(FS-IPW)','Product and Quotation Management(FS-PQM)','All the above',4,112),(28931,'Which vulnerability database is used behind SVM system?','OSVDB','Exploit-DB','NVD','Commercial DB from vendor',3,'How often will program owner get notification from SVM system?','Daily','Weekly','Monthly','When there is new vulnerability',2,113),(28758,